import { JsonProof, verify } from '../proof-system/zkprogram.js';

import { it, describe } from 'node:test';
import { expect } from 'expect';
import { Field } from '../provable/field.js';

const verificationKey = {
  data: '',
  hash: new Field(3386199237106052514483028598342080466726836854279486504176575292823052975570n),
};

const proof = {
  publicInput: [],
  publicOutput: [],
  maxProofsVerified: 0,
  proof:
    '',
};

describe('Verifying a cached proof', () => {
  it('should verify a proof', async () => {
    const valid = await verify(proof as JsonProof, verificationKey);
    expect(valid).toBe(true);
  });
});
